  associated_reports:
  - id: 8
    name: Email / Phone - for Status, Source, Rank
    description: Names and emails or phone numbers for players having a specific status
      or method between certain dates (for example "complete") that did not have a
      status or method at any time in the past (for example, "opt-out")
    sql: "select distinct m.id master_id, msid, rec_type, UPPER(LEFT(pi.first_name,1))
      || LOWER(SUBSTRING(pi.first_name,2)) as first,\r\nUPPER(LEFT(pi.last_name,1))
      || LOWER(SUBSTRING(pi.last_name,2)) as last,\r\ndata \r\nfrom player_infos pi
      \r\n:filter_previous\r\ninner join masters m on m.id = pi.master_id\r\ninner
      join player_contacts pc \r\non pc.master_id = pi.master_id\r\nWHERE \r\npc.rank
      in (:contact_rank)\r\nAND pc.rec_type in (:rec_type)\r\nAND ((:source) is NULL
      or pc.source IN (:source) )\r\nAND pi.rank in (:player_has_rank)\r\nAND (\r\n
      \ (:with_status) is null AND (:with_method) is null\r\n  OR exists\r\n  (select
      th.master_id from tracker_history th where\r\n     th.master_id = pi.master_id
      and \r\n     (sub_process_id in (:with_status) or protocol_event_id in (:with_method)
      )\r\n     and (:from_date is null or  event_date >= :from_date) \r\n     and
      (:to_date is null or event_date <= :to_date)\r\n  )\r\n)\r\nAND (\r\n  (:without_status)
      is null AND (:without_method) is null\r\n  OR\r\n  not exists\r\n  (select th.master_id
      from tracker_history th where\r\n     th.master_id = pi.master_id and \r\n     (sub_process_id
      in (:without_status) or protocol_event_id in (:without_method) )\r\n\r\n  )\r\n
      \ \r\n)\r\n"
    search_attrs: "contact_rank: \r\n  general_selection: \r\n    label: Select contact
      records with rank  [*]\r\n    item_type: player_contacts_rank\r\n    multiple:
      multiple\r\n    default: \r\n      - 10\r\nrec_type: \r\n  general_selection:
      \r\n    item_type: player_contacts_type\r\n    multiple: multiple\r\n    label:
      for contact types  [*]\r\n    default: \r\n      - email\r\n      - phone\r\n\r\n\r\nwith_status:
      \r\n  sub_process: \r\n    label: for players having status\r\n    all: true\r\n
      \   multiple: multiple\r\n    default:\r\n      - 39\r\nwith_method:\r\n  protocol_event:\r\n
      \   label: or method\r\n    all: true\r\n    multiple: multiple\r\n    default:\r\n\r\nfrom_date:
      \r\n  date: \r\n    label: where the event date is from\r\n    all: true\r\n
      \   multiple: single\r\nto_date: \r\n  date: \r\n    label: and the event date
