  - id: 19
    name: Name, Address or Contact
    description: "Enter a name to find in player or pro info, a word to find anywhere
      in the address, or an email or phone number.\r\nEnter first name (or initial)
      and last name  (separated with a space) to refine name searches."
    sql: "select distinct m.id master_id, \r\npi.first_name, pi.middle_name, pi.last_name,
      pi.nick_name,\r\npro.first_name, pro.middle_name, pro.last_name, pro.nick_name,\r\na.street,
      a.street2, a.city, a.state, a.zip, \r\npc.data, pc.rec_type,\r\nregexp_replace(:phone_or_email,
      '\\W+', '', 'g') test\r\nfrom masters m\r\ninner join player_infos pi\r\non
      pi.master_id = m.id\r\nleft join addresses a\r\non m.id = a.master_id\r\nleft
      join pro_infos pro\r\non pro.master_id = m.id\r\nleft join player_contacts pc\r\non
      pc.master_id = m.id\r\nwhere \r\n(:name is null \r\nor pi.first_name ~* :name\r\nor
      pro.first_name ~* :name\r\nor pi.last_name ~* :name\r\nor pro.last_name ~* :name\r\nor
      pi.middle_name ~* :name\r\nor pro.middle_name ~* :name\r\nor pi.nick_name ~*
      :name\r\nor pro.nick_name ~* :name\r\nor( \r\n    pi.first_name ~* coalesce(split_part(:name,
      ' ', 1),'none')\r\n    AND pi.last_name ~* coalesce(split_part(replace(:name,
      '  ', ' '), ' ', 2),'none')\r\n  )\r\n) AND\r\n(:phone_or_email is null \r\nor
      regexp_replace(pc.data, '\\W+', '', 'g') ~* regexp_replace(:phone_or_email,
      '\\W+', '', 'g')\r\n)\r\nAND\r\n(:word_in_address is null \r\nor street ~* :word_in_address\r\nor
      street2 ~* :word_in_address\r\nor street3 ~* :word_in_address\r\nor city ~*
      :word_in_address\r\nor state ~* :word_in_address\r\nor zip ~* :word_in_address\r\nor
      region ~* :word_in_address\r\nor postal_code ~* :word_in_address\r\n)\r\n"
    search_attrs: "name: \r\n  text: \r\n    all: true\r\n    multiple: single\r\nword_in_address:
      \r\n  text: \r\n    all: true\r\n    multiple: single\r\n\r\n\r\nphone_or_email:
